import styled from 'styled-components'

const Container = styled.main`
  margin: 0;
  padding: 0;
  width: 100vw;
  height: 100vh;
  background-color: #292929;
`

const Layout = props => (
  <Container>
    { props.children }
  </Container>

)

export default Layout
